import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from 'react-router-dom'

import Home from './App.jsx'
import Artigo from './Artigo.jsx'


function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/artigos" element={<Artigo />} />
      </Routes>
    </Router>
  )
}

export default App;
